import React from 'react';
import CardInfo from '../Components/CardInfo';
import test from '../assets/heirloom_salad.png';

function Card(props) {
    console.log("props", props.item.imgSrc)

    return(
        <div className="d-inline-block g-card" onClick={(event) => props.click(props.item)}>
            <img className="g-card-image" src={require((props.item.imgSrc))} alt={props.item.imgSrc} />
            {/* <img className="g-card-image" src={test} alt={props.item.imgSrc} /> */}
            {/* <img src="https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fwww.rd.com%2Fwp-content%2Fuploads%2F2019%2F11%2Fcat-10-e1573844975155.jpg&f=1&nofb=1"/> */}
            { props.item.selected && <CardInfo title={props.item.title} subTitle={props.item.subTitle} link={props.item.link} />}

        </div>
    )
}

export default Card;
